@abendzeitung: Markus Söder fordert Neuwahlen, weil er das Land durch die Ampel, der er die Kompetenz zur Problemlösung abspricht, in Gefahr sieht. Zu Recht?
Gysi: Na ja, die Ampel ist nicht sonderlich beliebt und sie ist schlicht und einfach überfordert. Aber wenn wir jetzt eine unionsgeführte Regierung hätten, wäre die auch überfordert. Es gäbe nur eine einzige Regierung, die nicht überfordert wäre – und das wäre eine unter meiner Leitung. Kleiner Scherz (lacht). Mit anderen Worten: Das ist im Moment einfach alles zu viel. Hinzu kommt, dass viele Entscheidungen getroffen wurden, bei denen man sich wirklich fragt, ob die Verantwortlichen noch richtig ticken.

